$(document).ready(function(){$('[data-toggle="tooltip"]').tooltip();$(".navbar a, .span a, footer a[href='#myPage'], a[href^='#']").on("click",function(n){if(this.hash!==""){n.preventDefault();var t=this.hash;$("html, body").animate({scrollTop:$(t).offset().top},900,function(){window.location.hash=t})}});String.prototype.replaceAll=function(n,t){var i=this;return i.replace(new RegExp(n,"g"),t)}});